import './App.css';
import React from 'react';
import DB from "./Data/DataBase.json";
import ForumPage from './Page/ForumPage';
import PostingPage from './Page/PostingPage';
import PostPage from './Page/PostPage'
import TopMenu from "./GUI/TopMenu";
import { BrowserRouter, Route, Routes } from 'react-router-dom';

function App() 
{
  var tem = StringSub("/","안녕하세요/저는/백종욱/입니다.");
  console.log(tem);

  return(
    <div>
      <BrowserRouter>
        <TopMenu />
        <Routes>
          <Route path= {`/`} element={<ForumPage/>} />
          <Route path= {`/${DB.PageList[0][0]}/*`} element={<ForumPage/>} />
          <Route path= {`/${DB.PageList[1][0]}`} element={<PostingPage/>} />
          <Route path= {`/${DB.PageList[2][0]}/*`} element={<PostPage/>} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

function StringSub(char,address)
{
  var result = [];
  var tem = 0;
  for(var i=0; i <= address.length; i++)
  { 
    if(address[i] != char)
    { 
      if(address.length == i) { result.push(address.substring(tem)); } else { continue; }
    } 
    else 
    {
      result.push(address.substring(tem,i));
      tem = i +1;
    } 
  }

  return result;
}

export default App;
